// import React from 'react';
import {Parallax, ParallaxLayer} from 'react-spring/renderprops-addons'
// import React from 'react'
import './App.css';
import { createStore } from 'redux';

import { Provider } from 'react-redux';
import ParalaxMy from "./components/elements/ParallaxMy";
import React, { Component } from "react";
import { BrowserRouter } from 'react-router-dom';
import { render } from "react-dom";
import "./components/elements/TemplatesContainer"
import MenuCont from "./components/MenuButton/MenuCont";
// import React from 'react';
// import { Switch, Route } from 'react-router-dom';

import { Switch, Route ,Link} from 'react-router-dom';

const initialState = {
    count: 0
};

function reducer(state=initialState,action) {
    switch(action.type) {
        case 'INCREMENT':
            // NO! BAD: this is changing state!
            state.count++;
            return state;

        case 'DECREMENT':
            // NO! BAD: this is changing state too!
            state.count--;
            return state;

        default:
            // this is fine.
            return state;
    }
}

const store = createStore(reducer);

const About1 = () =>{
  return(
      <h2>Kek</h2>
  );

};
const About2 = () =>{
  return(
      <div>
          <button type="button" className="btn btn-primary">Primary</button>

          <button type="button" className="btn btn-danger">Danger</button>
      </div>

  );

};

const MainPage = () =>{
  return(
      <div>
      <Link to="/signup">
        <button variant="outlined">
          Sign up
        </button>
      </Link>
          <Link to="/about2">
              <button variant="outlined">
                  Sign up
              </button>
          </Link>
      </div>

  );

};
const Main = () => {
  return (

      <Switch>
        <Route exact path='/' component={ParalaxMy}></Route>
        <Route exact path='/about2' component={About2}></Route>
        <Route exact path='/signup' component={MenuCont}></Route>
      </Switch>
  );
};



class App extends Component {

  removeCharacter = index => {
  const { characters } = this.state;

  this.setState({
    characters: characters.filter((character, i) => {
      return i !== index
    }),
  })
};
  handleSubmit = character => {
  this.setState({ characters: [...this.state.characters, character] })
};


  render() {
    return (
        <Provider store={store}>
            <BrowserRouter>
              <div>
                <Main/>
              </div>
            </BrowserRouter>
        </Provider>
    );
  }
}



render(<App />, document.getElementById("root"));


export default App;
